import { Container, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import './Home.css'; 
import footer from '../components/Footer.js'; // Importa el componente Footer

const Home = () => {
    const navigate = useNavigate();

    return (
        <div className="home-container">
            <Container className="text-center content">
                <h1>Bienvenido a iDrive</h1>
                <p>Gestiona tus clases de conducción fácilmente.</p>
                <Button variant="primary" size="lg" onClick={() => navigate('/login.js')}>
                    Iniciar Sesión
                </Button>
            </Container>
            <footer /> {/* Aquí se incluye el componente Footer */}
        </div>
    );
};

export default Home;
